import React from "react";
import Table from "react-bootstrap/Table";

const Showdata = ({
  InvoiceNumber,
  InvoiceDate,
  ProductName,
  Pack,
  ActualRate,
  Quantity,
}) => {
  return (
    <Table striped bordered hover>      
       <tbody>
       <Table striped bordered hover>
        {
          sheetitems.map((item, index)=>{
            return (
              <tr key={index}>
                <Showdata 
                  key={index}
                  InvoiceNumber = {item.C}
                  InvoiceDate = {item.D}
                  ProductName = {item.F}
                  Pack = {item.G}
                  ActualRate = {item.O}
                  Quantity = {item.U}
                  />
     
              </tr>
            )
          })
        }
      </Table>
      </tbody>
    </Table>
  );
};

export default Showdata;
